import React, { Component, useState } from "react";
import Highcharts from "highcharts";
import HighchartsReact from "highcharts-react-official";

export default function Home() {
  const options = {
    chart: {
      type: "solidgauge",
      backgroundColor: "#0000"
    },
    title: {
      text: "My chart"
    },
    yAxis: {
      labels: {
        enabled: false
      },
      stops: [
        [
          0.5,
          {
            linearGradient: {
              x1: 0,
              x2: 0,
              y1: 0,
              y2: 1
            },
            stops: [
              [0, "#03D9F0"] /*03D9F0*/,
              [1, "#06A1D9"] /*06A1D9*/
            ]
          }
        ],
        [
          0.9,
          {
            linearGradient: {
              x1: 0,
              x2: 1,
              y1: 0,
              y2: 0
            },
            stops: [
              [0, "#06A1D9"],
              [1, "#03D9F0"]
            ]
          }
        ]
      ],
      min: 0,
      max: 800,
      gridLineColor: "transparent",
      lineColor: "transparent",
      minorTickLength: 0,
      tickPositions: [650],
      tickColor: "#000000",
      tickPosition: "inside",
      tickLength: 25,
      tickWidth: 3,
      zIndex: 100 //added zindex
    },
    series: [
      {
        data: [390]
      }
    ]
  };
  return (
    <div className="row">
      <div className="col col-12">
        <h1>Home</h1>
        <div class="card">
          <div class="card-body">
            <HighchartsReact highcharts={Highcharts} options={options} />
          </div>
        </div>
      </div>
    </div>
  );
}
